// ==UserScript==
// @name          제목 및 URL 복사 (Alt + C)
// @namespace     제목 및 URL 복사 (Alt + C)
// @match         *://*/*
// @version       0.1
// @description   현재 웹페이지의 Title + URL을 옵션에 따라 클립보드에 복사하는 스크립트. (URL은 자동으로 디코딩되어 문자열로 처리됨.)
// @icon          data:image/png;base64,
// @author        mickey90427 <mickey90427@naver.com>
// @grant         GM_addStyle
// @grant         GM_download
// @license       MIT
// @downloadURL https://update.greasyfork.org/scripts/502955/%EC%A0%9C%EB%AA%A9%20%EB%B0%8F%20URL%20%EB%B3%B5%EC%82%AC%20%28Alt%20%2B%20C%29.user.js
// @updateURL https://update.greasyfork.org/scripts/502955/%EC%A0%9C%EB%AA%A9%20%EB%B0%8F%20URL%20%EB%B3%B5%EC%82%AC%20%28Alt%20%2B%20C%29.meta.js
// ==/UserScript==

// Add an event listener to capture the Alt + C key combination
document.addEventListener('keydown', function(event) {
  if (event.altKey && event.code === 'KeyC') {
    event.preventDefault();

    // Show prompt to get user input for copying options
    var copyOption = prompt('복사 옵션을 선택하세요.\n1. 일반 복사\n2. 링크 태그 복사\n3. 마크다운 복사');

    // Get the decoded URL
    var decodedURL = decodeURIComponent(window.location.href);

    // Create a temporary textarea element to copy the text
    var tempTextArea = document.createElement('textarea');

    // Set the copied text based on the user's choice
    if (copyOption === '1') {
      tempTextArea.value = document.title + '\n' + decodedURL;
    } else if (copyOption === '2') {
      tempTextArea.value = '<a href="' + decodedURL + '">' + document.title + '</a>';
    } else if (copyOption === '3') {
      tempTextArea.value = '[' + document.title + '](' + decodedURL + ')';
    } else {
      // alert('올바른 옵션을 선택하세요.');
      return;
    }

    // Append the textarea element to the document
    document.body.appendChild(tempTextArea);

    // Select the text in the textarea
    tempTextArea.select();

    // Copy the selected text
    document.execCommand('copy');

    // Remove the temporary textarea element
    document.body.removeChild(tempTextArea);

    // Display a confirmation box in the center of the page
    var confirmationBox = document.createElement('div');
    confirmationBox.style.position = 'fixed';
    confirmationBox.style.top = '50%';
    confirmationBox.style.left = '50%';
    confirmationBox.style.transform = 'translate(-50%, -50%)';
    confirmationBox.style.padding = '20px';
    confirmationBox.style.backgroundColor = '#333'; // 배경색 고정
    confirmationBox.style.border = '1px solid #ffffff'; // 테두리색 고정
    confirmationBox.style.borderRadius = '5px';
    confirmationBox.style.boxShadow = '0 2px 5px rgba(0, 0, 0, 0.3)';
    confirmationBox.style.zIndex = '9999';
    confirmationBox.style.color = '#ffffff'; // 텍스트 색상 고정
    confirmationBox.style.fontFamily = 'Arial, sans-serif'; // 글꼴 고정
    confirmationBox.innerText = '복사가 완료되었습니다.';

    // Append the confirmation box to the document
    document.body.appendChild(confirmationBox);

    // Remove the confirmation box after 2 seconds
    setTimeout(function() {
      document.body.removeChild(confirmationBox);
    }, 2000);
  }
});